import {BrowserRouter, Routes, Route} from 'react-router-dom'
import {signup} from "./paginas/signup"

function App(){
  return (
    <BrowserRouter>
      <Routes>
    <Route path = "/signup" element={<signup />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App
